import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
       <body>
          <div className="Big-Box">
             <header className="Big-Box">
                <h1>
                <p>
                 Mental health issues are challenging to deal with alone.
                 </p>
                 <p>
                 Just know that we are here for you, please reach out!
                 </p>
                </h1>
            </header>
         </div>
      </body>
    </div>



  );
}



export default App;
